import Banner from '../sections/banner';

function Explore() {
    return(
        <header sx = {styles.header} className= {className} >
        <Container sx = {styles.container}>
          <Logo src = {LogoDark} />
          <Flex as = "nav" sx = {styles.nav}>
              <Link
                activeClass="active"
                to="home"
                spy= {true}
                smooth = {true}
                offset= {-180}
                duration ={500}
              >
                Home
              </Link>
              <Link
                activeClass="active"
                to="products"
                spy= {true}
                smooth = {true}
                offset= {-80}
                duration ={500}
              >
                Products
              </Link>
              <Link
                activeClass="active"
                to="pricing"
                spy= {true}
                smooth = {true}
                offset= {-50}
                duration ={500}
              >
                Pricing
              </Link>
              <Link
                activeClass="active"
                to="gallery"
                spy= {true}
                smooth = {true}
                offset= {-180}
                duration ={500}
              >
                Gallery
              </Link>
          </Flex>
          <Button className= "donate__btn" variant ="secondary" aria-label ="Contact">
            Contact
          </Button>
          <MobileDrawer/>
        </Container>
      </header>
  );
    
};

export default Explore;
